import Counter from "./counter";
import Navbar from "./navbar";
import Popup from "./popup";

class Counters extends Component {
  state = {
    counters: [
      { id: 1, value: 4 },
      { id: 2, value: 2 },
      { id: 3, value: 1 },
      { id: 4, value: 10 },
    ],
  };
  render() {
    return (
      <div>
        <Navbar></Navbar>
        <popup></popup>
      </div>
    );
  }
}
